import React from "react";
import { Nav } from 'react-bootstrap';
import barrioviajero from './barrioviajero.png';
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";


class Navbar extends React.Component {
  render() {
    return (
      <React.Fragment>
        <Router>
        <Nav variant="tabs" defaultActiveKey="/home" className="justify-content-center h6 p-3 ">
          <Nav.Item>
            <img src={barrioviajero} />
          </Nav.Item>
          <Nav.Item >
            <Nav.Link as={Link} to="/" className="text-success" id="nav1">Estudios</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link as={Link} to="/" className="text-success">Skills</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1" className="text-success">Proyectos</Nav.Link>
          </Nav.Item>
          <Nav.Item>
            <Nav.Link eventKey="link-1" className="text-success">Experiencia </Nav.Link>
          </Nav.Item>
        </Nav>


        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/about" component={About} />
          <Route exact path="/contact" component={Contact} />
          <Route exact path="/horarios" component={Horarios} />
        </Switch>
        </Router>
      </React.Fragment>
      
    );
  }
}

export default Navbar;
